import {useState} from 'react';
import MedalsBar from './MedalsBar';
import MedalsScroll from './MedalsScroll';

const MedalsSection = () => {
    const [ifEarned, setIfEarned] = useState(true);

    function setEarned(input){
        setIfEarned(input);
    }

    useEffect(
        () => {
          if (ifEarned) {
            console.log(ifEarned, " console");
          }
        }, [ifEarned]
      );

    return (
    <div id = "MedalsSection">
        <div id = "MedalsHeader" className ="selectButtonHeader">
            <h1>Medals</h1>
            <MedalsBar changeFunction = {setEarned}></MedalsBar>
        </div>

        <MedalsScroll type = {ifEarned}></MedalsScroll>


    </div>
    );
}

export default MedalsSection;
